    [63577] = {
        id = 63577,
        text = "1. Traveling to the past with the help of Kurumi, the vengeful Origami Tobiichi realized that the one who killed her parents was herself all along... the despair caused Sephira Crystal to inverse, bringing [Satan] to the world. Desire to kill and destroy was all that left in her mind. \n2. Destruction of Inverse Origami put Tengu City in unprecedented danger! We need you all to help appease the situation! Complete quests of [Weak-up Operation] to collect [Feather of Despair] and weak her up!\n3. Even the smallest contribution could make a difference. As [Feather of Despair] collected reaches a certain goal, phase rewards and dates in [Memorial Dates] will be unlocked. \n4. [Memorial Dates] connect all stars like a highway. With the special device developed by Ratatoskr, you can travel to good memories of Origami and collect [Memory Fragment] in every date to complete the memory jigsaw. That way, Origami can be awaken form the darkness!",
