    [63578] = {
        id = 63578,
        text = "Travel through time and space just to meet you again - \nThis space, called as [Space of Memories] is made of Origami's memories. The timeline of this space is quite unstable. You have to explore this space, complete different quests and unlock [Memorial Dates], then find Origami in the date. \nYou can't quit midway once you begin a memorial date. Completing or quitting a date causes memory interruption, making it impossible to re-enter the date. Please make choices in date with caution. \nEvery [Memorial Date] has 1 hidden memory fragment. Collect all memory fragments to unlock the final date. \n\nTimeline Jump: \nRatatoskr developed a special device to collect energy in the space of memories. \nYou can spend some energy to jump to another timeline and explore another piece of memory. \nWhenever you jump to another timeline, there will be a new [Memorial Date], and you cannot go back to previous Memorial Date. So make sure you finish the date before making the jump.",
