    [63588] = {
        id = 63588,
        text = "1. [Stage Dispatch] Meet certain condition and you can dispatch Spirits to qualified stages.\n2. [Suggested Star Level] When total star level of dispatched Spirits reach the suggested stars, you will get extra Dispatch Rewards. Star Level Bonus Rules: \nTotal Star Level of Dispatched Spirits Revenue Boost\n1-star 30%\n2-star 70%\n3-star 100%\n4-star 113%\n5-star 123%\n6-star 131%\n7-star 138%\n8-star 144% \n9-star 150%\n3.[AP Cost] Each Spirit dispatched consumes 1 AP every 1 min.\n4. [Complete Now] Spend 2 diamonds for every 1 min to instantly clear the current stage.\n5. [Keep Dispatching] If you can afford the cost, dispatch to the next stage once you clear the current stage.\n6. [Revenue Calculation] Base Revenue*Star Level Bonus+Base Revenue*Bonds Bonus+ Bonds extra rewards\n7. In Online Battles, dispatch times = reward times\n8. Kerubiel Dispatch won't grant the first clearance reward for normal challenges.\n9. Tap the yellow mark on a stage to cancel dispatch.",
