    [62999] = {
        id = 62999,
        text = "2. Price and Duration\nYou can subscribe the [Month Card (Auto-renew)] in the game at the cost of $3.99 for 30 days. \n\n3. Subscription Contents\nSubscribers of [Month Card (Auto-renew)] will get perks in the duration as listed below: \n①Once subscribed, the system will instantly offer 300 diamonds and 60 more daily for 30 days.\n②Sign-up in a row to get Month Card Coins and use them to exchange special pack only for Month Card users for free. \n\n4. About Auto-Renewal\nSubscriptions from AppStore are auto-renewable and the payment is confirmed with iTunes Account. If you want to cancel subscription, go to iTunes/Apple ID - Subscriptions. Auto-renewal charges within 24hr before a billing cycle ends and confirms payment via iTunes account. If you want to cancel subscription, please do so at least 24hr before a billing cycle ends. If you fail to cancel in time, the subscription will be renewed automatically. \n\n5. Cancel Subscription\nIf you want to cancel subscription, tap \"Settings\"->\"iTunes Store & App Store\"->\"AppleID\"->\"View AppleID\" ->\"Subscriptions\"->Find \"Date A Live: Spirit Pledge\" and cancel subscription.",
    },
