    [63004] = {
        id = 63004,
        text = "Equipping Sephiroth grants character with stats and extra effects. \nSephiroth have 2 types of stats: main stats and random stats. Main stats are HP, ATK and DEF. They will go up along with the level of Sephiroth. Random stats are generated when Sephira is acquired. Based on quality, a Sephira can have up to 4 random stats. \nExtra effects include Sephira extra skills, combo skills and set skills. Each Sephira has 1 unique extra skill. When 2 or more Sephiroth are equipped, if two are adjacent on the Kabbalah Tree, a combo skill will be activated. Tap \"Combo\" button to check the Kabbalah Tree. When 3 Sephiroth equipped by a character is of the same set and 3 combo stats are all activated, set skill of the set will be activated. \nAlso, Sephiroth can be changed, enhanced, refined, modified, and starupped. Those will be introduced in corresponding pages.",
