    [3310011] = {
        id = 3310011,
        text = "11. Club honor is connected to the club leaderboard. More will be revealed soon. Stay tuned!",
    },
    [3310010] = {
        id = 3310010,
        text = "10. There will be individual and club ranking in these mode. Individual points is a club member's damage dealt to bosses, while clubs are ranked by progress made in the cycle (highest level boss killed, damage dealt). Club ranking will be displayed during the next cycle.",
