    [3310009] = {
        id = 3310009,
        text = "9. There are 2 kinds of battle rewards: 1st kill reward and last-hit reward. After killing a boss for the 1st time, you can claim 1st kill reward before the next cycle starts. When a cycle ends, club members will get rewards for the highest-level boss defeated plus bosses 1 and 2 levels below. These rewards can be claimed before the challenge phase of next cycle starts. If not claimed in time, all rewards will disappear forever.",
