    [2130517] = {
        id = 2130517,
        text = "Unclaimed Snowman Workshop Rewards",
    },
    [2130516] = {
        id = 2130516,
        text = "1. Auto refresh 3 stages for each player at 0:00 daily. Tap the stage icon to create a room. Once clear, you can't challenge the stage again. \n\n2. You can spend diamond to reset stages instantly. Please beware: Unchallenged stages will be reset as well. You have limited chance to reset daily. \n\n3. Players can team up in the bobby to challenge event stages or assist others do so (which grants the same stage rewards). \n\n4. You have limited assist chances daily, which reset daily. You should use your chances within each day. \n\n5. After December 29, you may encounter new stage which drops new snowman modification material - \"Gearwheel\". \n\n6. After January 3, you may encounter new stage which drops new snowman modification material – \"Screw\".",
    },
    [2130515] = {
        id = 2130515,
        text = "Event Intro",
    },
    [2130514] = {
        id = 2130514,
        text = "1. Christmas Clash: \nComplete quests for Spirits and you will get Christmas gifts from them! You could get Snowballs, 2019 Christmas Sephira, 2019 Christmas Exclusive CG!\n\n2. Snowman Clash: \nChristmas is coming! Let's have a snowball fight with snowmen! Team up to finish snowman challenge and collect materials to upgrade skills for the snowman factory. And you'll receive rewards like Snowballs, Christmas avatars, Christmas avatar frames and Christmas keepsakes!\n\n3. Christmas Support: \nDuring the event, packs bought with pack coins or via Top-up - \"Good for New Players\", \"Hot\", \"Timed\", \"Cultivation Fund\" under Supply Station increase server progress. As the progress builds up, rebate rewards will be offered!",
    },
