        text = "Wanna see your beloved Spirit in the cutest clothes on the home page?\n\n1. In the Fav Girl page, you can put clothes on Spirits and select the best girl which will be displayed on your home page. \n\n2. In the Fav Girl avatar list on the left, select avatars of unlocked Spirits and tap \"Switch\" on the right to change Fav Girl. \n\n3. You can tap \"Change\", \"Info\" and \"Pose\" tabs to preview the effects before making the change. \n\n4. \"Change\" tag: Drag costume cards here to check how a Spirit looks like in all costumes. \n\n5. \"Info\" tag: Check here for each Spirit's base info and backstory, maybe even some private stuff!\n\n6. \"Pose\" tag: You can check how Spirits react when you touch them. If Favor is not high enough, you can only see some lines~\n\n7. Plus all the \"locked\" contents in the interface can be viewed, giving you some \"guidance in advance\"\n-------------------------------------------\n\nSlideshow is live!\n\nNow you can set multiple Spirits in different costumes (only advanced ones) as Fav Girl. When Slidewhow is on, Fav Girl will be shown in the home page at a set interval.",
    },
