        text = "Equipping gems enhance characters' skills. Gems have base and extra effects. Base effects mostly boost skill damage. Rarer gems grant bigger boosts. Gems of S Class or above have 1-3 extra effects depending on rarity, i.e. reduce skill CD, increase extra DMG etc. \nExtra effects of gems are not fixed. Like random stats of Sephiroth, they are determined from a skill pool at random. When gems with extra effects are equipped, skill effects will be shown in the Angel page. Each gem is bound to a skill slot of a character, which means it can only be equipped on the slot by the character.",
